'en','messages:anonpreviewwarning','s:90:\"\'\'You are not logged in. Saving will record your IP address in this page\'s edit history.\'\'\";'),('en','messages:missingsummary','s:133:\"\'\'\'Reminder:\'\'\' You have not provided an edit summary.\nIf you click \"{{int:savearticle}}\" again, your edit will be saved without one.\";'),('en','messages:missingcommenttext','s:29:\"Please enter a comment below.\";'),('en','messages:missingcommentheader','s:153:\"\'\'\'Reminder:\'\'\' You have not provided a subject/headline for this comment.\nIf you click \"{{int:savearticle}}\" again, your edit will be saved without one.\";'),('en','messages:summary-preview','s:16:\"Summary preview:\";'),('en','messages:subject-preview','s:25:\"Subject/headline preview:\";'),('en','messages:blockedtitle','s:15:\"User is blocked\";'),('en','messages:blockedtext','s:572:\"\'\'\'Your username or IP address has been blocked.\'\'\'\n\nThe block was made by $1.\nThe reason given is \'\'$2\'\'.\n\n* Start of block: $8\n* Expiry of block: $6\n* Intended blockee: $7\n\nYou can contact $1 or another [[{{MediaWiki:Grouppage-sysop}}|administrator]] to discuss the block.\nYou cannot use the \"email this user\" feature unless a valid email address is specified in your [[Special:Preferences|account preferences]] and you have not been blocked from using it.\nYour current IP address is $3, and the block ID is #$5.\nPlease include all above details in any queries you make.\";'),('en','messages:autoblockedtext','s:629:\"Your IP address has been automatically blocked because it was used by another user, who was blocked by $1.\nThe reason given is:\n\n:\'\'$2\'\'\n\n* Start of block: $8\n* Expiry of block: $6\n* Intended blockee: $7\n\nYou may contact $1 or one of the other [[{{MediaWiki:Grouppage-sysop}}|administrators]] to discuss the block.\n\nNote that you may not use the \"email this user\" feature unless you have a valid email address registered in your [[Special:Preferences|user preferences]] and you have not been blocked from using it.\n\nYour current IP address is $3, and the block ID is #$5.\nPlease include all above details in any queries you make.\";'),('en','messages:blockednoreason','s:15:\"no reason given\";'),('en','messages:whitelistedittext','s:29:\"You have to $1 to edit pages.\";'),('en','messages:confirmedittext','s:155:\"You must confirm your email address before editing pages.\nPlease set and validate your email address through your [[Special:Preferences|user preferences]].\";'),('en','messages:nosuchsectiontitle','s:19:\"Cannot find section\";'),('en','messages:nosuchsectiontext','s:115:\"You tried to edit a section that does not exist.\nIt may have been moved or deleted while you were viewing the page.\";'),('en','messages:loginreqtitle','s:14:\"Login required\";'),('en','messages:loginreqlink','s:6:\"log in\";'),('en','messages:loginreqpagetext','s:32:\"You must $1 to view other pages.\";'),('en','messages:accmailtitle','s:13:\"Password sent\";'),('en','messages:accmailtext','s:168:\"A randomly generated password for [[User talk:$1|$1]] has been sent to $2. It can be changed on the \'\'[[Special:ChangePassword|change password]]\'\' page upon logging in.\";'),('en','messages:newarticle','s:5:\"(New)\";'),('en','messages:newarticletext','s:239:\"You have followed a link to a page that does not exist yet.\nTo create the page, start typing in the box below (see the [[{{MediaWiki:Helppage}}|help page]] for more info).\nIf you are here by mistake, click your browser\'s \'\'\'back\'\'\' button.\";'),('en','messages:newarticletextanon','s:22:\"{{int:newarticletext}}\";'),('en','messages:talkpagetext','s:31:\"<!-- MediaWiki:talkpagetext -->\";'),('en','messages:anontalkpagetext','s:470:\"----\n\'\'This is the discussion page for an anonymous user who has not created an account yet, or who does not use it.\'\'\nWe therefore have to use the numerical IP address to identify him/her.\nSuch an IP address can be shared by several users.\nIf you are an anonymou