INSERT INTO `text` VALUES (1,'\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(2,'<noinclude>\nThis widget allows you to add a [https://developers.google.com/youtube/player_parameters YouTube video player] to your wiki page.\n\n== Using this widget ==\nFor information on how to use this widget, see the [http://www.mediawikiwidgets.org/YouTube widget description page on MediaWikiWidgets.org].\n\n== Copy to your site ==\nTo use this widget on your site, just install the [http://www.mediawiki.org/wiki/Extension:Widgets MediaWiki Widgets extension] and the copy [{{fullurl:{{FULLPAGENAME}}|action=edit}} full source code] of this page to your wiki, as an article called \'\'\'{{FULLPAGENAME}}\'\'\'.\n</noinclude><includeonly><iframe width=\"<!--{$width|escape:\'html\'|default:\'425\'}-->\" height=\"<!--{$height|escape:\'html\'|default:355}-->\" src=\"https://www.youtube.com/embed/<!--{if isset($playlist)}-->?listType=playlist&list=<!--{$playlist|escape:\'urlpathinfo\'}--><!--{else}--><!--{$id|escape:\'urlpathinfo\'}--><!--{/if}-->\" frameborder=\"0\" allowfullscreen></iframe></includeonly>','utf-8'),(3,' {{#widget:YouTube|id=DWef69ItVrU}}\n\n\n\n\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(4,'{{#widget:WEnotes|tag=wikieducator|count=20}}\n\n\n\n\n\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(5,'\n\n\n\n\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(6,'<noinclude>An aggregated miniblog feed from [http://WikiEducator.org/WEnotes WikiEducator], [http://plus.google.com g+], [http://twitter.com/ Twitter], [http://moodle.wikieducator.org/ Moodle], and [http://ask.OERuniversity.org/ AskBot].\n\n== Usage ==\n<nowiki>{{#widget:</nowiki>{{PAGENAME}}<nowiki>|tag=wikieducator|count=20}}</nowiki>\n\n== Parameters ==\n* \'\'\'tag\'\'\' - tag to follow (defaults to \'\'wikieducator\'\'), it must not be prefixed with \'#\'.\n* \'\'\'count\'\'\' - number of items to display (defaults to 20)\n\n== Implementation Note ==\nThe feed is inserted into a named <nowiki><DIV></nowiki> on the page, allowing adding style elements around it.\n\n</noinclude><includeonly>\n<div class=\"WEnotes WEnotes-<!--{$count|escape:\'quotes\'}-->-<!--{$tag|escape:\'quotes\'}-->\"><img class=\"WEnotesSpinner\" src=\"/skins/common/images/Ajax-loader.gif\" alt=\"Loading...\" style=\"margin-left: 53px;\" /></div>\n<script type=\"text/javascript\">/*<![CDATA[*/\n$(function() {\n  if (!window.WEnotes) {\n    window.WEnotes = true;\n    $.getScript(\'/extensions/WEnotes/WEnotesClient.js\');\n  }\n})/*]]>*/</script>\n</includeonly>','utf-8'),(7,'\n{{#widget:WEnotes|tag=wikieducator|count=20}}\n\n\n\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(8,'\nMenuTabsToggle[ResourceLoader|dependencies=jquery.cookie]|MenuTabsToggle.js|MenuTabsToggle.css\n\n\'\'\'MediaWiki has been successfully installed.\'\'\'\n\nConsult the [//meta.wikimedia.org/wiki/Help:Contents User\'s Guide] for information on using the wiki software.\n\n== Getting started ==\n* [//www.mediawiki.org/wiki/Manual:Configuration_settings Configuration settings list]\n* [//www.mediawiki.org/wiki/Manual:FAQ MediaWiki FAQ]\n* [https://lists.wikimedia.org/mailman/listinfo/mediawiki-announce MediaWiki release mailing list]\n* [//www.mediawiki.org/wiki/Localisation#Translation_resources Localise MediaWiki for your language]','utf-8'),(9,'For the Files/Directorys list:\n <dirlist name=\"/var/www/html/downloads\" fileprefix=\"\" sort=\"true\" encoded=\"false\"></dirlist>\nnote:\n fileprefix=\"test/sub\" // will link to /wiki/test/sub/filename\n encoded=\"true\" // requires name in urlencoded format, e.g. /var/www/ftp/shared/%23B%20Buchf%FChrung (to allow htmlspecial char in filenames)\n\nfor the DateTime of an file :\n<font color=red>\'\'\'<FsDateTime name=\"/var/www/html/downloads/DataCollector/Setup.2.0.exe\">\n</FsDateTime>\'\'\'</font>','utf-8'),(10,'<poll>','utf-8'),(11,'#REDIRECT [[Feedback demo]]','utf-8'),(12,'<graph>','utf-8'),(13,'','utf-8'),(14,'','utf-8'),(15,'This is a demo graph\n\n\n<graph>','utf-8'),(16,'<voting 1|2|3>','utf-8'),(17,'<voting arg1=name arg2=place>','utf-8'),(18,'<voting arg1=name arg2=place>THis is me</voting>','utf-8'),(19,'<voting arg1=\"name\" arg2=\"place\">THis is me</voting>','utf-8'),(20,'<voting googleplusid=\"name\" twitter=\"place\">THis is me</voting>','utf-8'),(21,'<mypage googleplusid=\"name\" twitter=\"place\">THis is me</voting>','utf-8'),(22,'#REDIRECT [[Mypage]]','utf-8'),(23,'[[File:Population.csv]]This is a demo graph\n\n\n<graph>','utf-8'),(24,'[[File:Population.txt]]\nThis is a demo graph\n\n\n<graph>','utf-8'),(25,'<mypage googleplusid=\"+JimTittsler\" twitter=\"place\">THis is me</voting>','utf-8'),(26,'<mypage googleplusid=\"+JimTittsler\" twitter=\"place\" />','utf-8');
